import React,{Component} from 'react';
import './style.css'

class FirstComponent extends Component{

   constructor(){
       super();
       this.state = {
           count : 0
       }
   }


    render(){
      return(
        <div className='First'>
             <button className="button" style={{backgroundColor:"green"}} onClick={increment}>
                 Button
             </button>
             <span className='count'>{this.state.count}</span>
        </div>
      )
    }


   increment(){
        alert('welcome');
   }

}



export default FirstComponent;
